const compress2 = (str) => {
    let result = [str[0]], count = 1;
    for(let i=1;i<str.length;i++){
        if(str[i] === str[i-1]){
            count++;
        } else {
            result.push(count);
            result.push(str[i]);
            count = 1;
        }
    }
    result.push(count);
    return result;
}
